import React from "react";
import { Container, Box, Typography, Button, Paper, Grid, TextField } from "@mui/material";
import { useNavigate } from "react-router-dom";

const signalementTypes = [
  {
    title: "Fraude bancaire",
    description: "Signalez toute opération suspecte sur votre compte ou carte bancaire.",
    image: "/images/diomaye.png"
  },
  {
    title: "Arnaque en ligne",
    description: "Déclarez un site frauduleux, phishing, ou escroquerie sur internet.",
    image: "/images/diomaye2.jpg"
  },
  {
    title: "Corruption",
    description: "Dénoncez un acte de corruption ou de favoritisme.",
    image: "/images/diomaye3.jpg"
  },
  {
    title: "Faux documents",
    description: "Signalez la falsification de documents officiels ou administratifs.",
    image: "/images/jub.png"
  },
  {
    title: "Autre anomalie",
    description: "Tout autre type d'anomalie ou de fraude à signaler.",
    image: "/images/pngtree-button-senegal-flag-vector-template-design-png-image_859977.png"
  }
];

function CarouselCards({ items }) {
  const [index, setIndex] = React.useState(0);
  const next = () => setIndex(i => (i + 1) % items.length);
  const prev = () => setIndex(i => (i - 1 + items.length) % items.length);
  React.useEffect(() => {
    const timer = setTimeout(next, 5000);
    return () => clearTimeout(timer);
  }, [index, items.length]);
  return (
    <Box sx={{ position: 'relative', width: '100%', mb: 4 }}>
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: 320 }}>
        {items.map((item, i) => (
          <Paper key={item.title} elevation={i === index ? 8 : 1} sx={{
            display: i === index ? 'flex' : 'none',
            flexDirection: 'column',
            alignItems: 'center',
            p: 4,
            borderRadius: 4,
            width: { xs: '100%', sm: 400 },
            mx: 'auto',
            background: 'rgba(255,255,255,0.98)',
            boxShadow: 6,
            minHeight: 320
          }}>
            <img src={item.image} alt={item.title} style={{ width: 90, height: 90, objectFit: 'cover', borderRadius: '50%', marginBottom: 16 }} />
            <Typography variant="h5" sx={{ fontWeight: 700, color: '#1a237e', mb: 1 }}>{item.title}</Typography>
            <Typography variant="body1" sx={{ color: '#374151', textAlign: 'center' }}>{item.description}</Typography>
          </Paper>
        ))}
      </Box>
      <Button onClick={prev} sx={{ position: 'absolute', top: '50%', left: 0, transform: 'translateY(-50%)', minWidth: 0, p: 1, bgcolor: 'rgba(0,0,0,0.15)', color: '#1a237e', borderRadius: '50%' }}>
        &#8592;
      </Button>
      <Button onClick={next} sx={{ position: 'absolute', top: '50%', right: 0, transform: 'translateY(-50%)', minWidth: 0, p: 1, bgcolor: 'rgba(0,0,0,0.15)', color: '#1a237e', borderRadius: '50%' }}>
        &#8594;
      </Button>
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2, gap: 1 }}>
        {items.map((_, i) => (
          <Box key={i} onClick={() => setIndex(i)} sx={{ width: 12, height: 12, borderRadius: '50%', bgcolor: i === index ? '#1a237e' : '#c3cfe2', cursor: 'pointer', border: '1px solid #1a237e' }} />
        ))}
      </Box>
    </Box>
  );
}

export default function SignalementPage() {
  const navigate = useNavigate();

  return (
    <Box sx={{ minHeight: '100vh', background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)', display: 'flex', alignItems: 'center', justifyContent: 'center', py: 6 }}>
      <Container maxWidth="md">
        <Paper elevation={12} sx={{ borderRadius: 6, p: { xs: 2, sm: 6 }, boxShadow: 10, background: 'rgba(255,255,255,0.98)' }}>
          <Box sx={{ display: 'flex', flexDirection: { xs: 'column', md: 'row' }, alignItems: 'center', mb: 4 }}>
            <img src="/images/jub.png" alt="Logo Sénégal" style={{ width: 90, marginRight: 32, borderRadius: '50%' }} />
            <Typography variant="h3" sx={{ fontWeight: 800, color: '#1a237e', mb: { xs: 2, md: 0 } }}>
              Signaler une anomalie ou une fraude
            </Typography>
          </Box>
          <CarouselCards items={signalementTypes} />
          <Typography variant="h6" sx={{ color: '#374151', mb: 4, textAlign: 'center' }}>
            Merci de remplir le formulaire ci-dessous pour signaler un problème, une anomalie ou une fraude. Notre équipe traitera votre demande dans les plus brefs délais.
          </Typography>
          <Box component="form" sx={{ mt: 2 }}>
            <Grid container spacing={3}>
              <Grid item xs={12} md={6}>
                <TextField label="Nom" name="nom" fullWidth required variant="outlined" />
              </Grid>
              <Grid item xs={12} md={6}>
                <TextField label="Prénom" name="prenom" fullWidth required variant="outlined" />
              </Grid>
              <Grid item xs={12} md={6}>
                <TextField label="Email" name="email" fullWidth required variant="outlined" type="email" />
              </Grid>
              <Grid item xs={12} md={6}>
                <TextField label="Téléphone" name="telephone" fullWidth variant="outlined" />
              </Grid>
              <Grid item xs={12}>
                <TextField label="Type d'anomalie ou de fraude" name="type" fullWidth required variant="outlined" />
              </Grid>
              <Grid item xs={12}>
                <TextField label="Description détaillée" name="description" fullWidth required variant="outlined" multiline rows={4} />
              </Grid>
            </Grid>
            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
              <Button type="submit" variant="contained" size="large" sx={{ background: 'linear-gradient(90deg, #1a237e 0%, #1976d2 100%)', color: '#fff', fontWeight: 700, borderRadius: '50px', px: 5, py: 1.5, boxShadow: 3 }}>
                Envoyer le signalement
              </Button>
            </Box>
          </Box>
        </Paper>
      </Container>
    </Box>
  );
}
